import React from 'react';


const Whyrecycle = () => {
    return (
        <section id="why-recycle" className="section">
            <h2>Why Recycle?</h2>
            <p>Recycling helps reduce waste, conserves natural resources, and minimizes pollution. Its a small step with a big impact on our environment.</p>
            <ul>
                <li>Save energy by reducing the need for raw materials.</li>
                <li>Protect ecosystems and wildlife.</li>
                <li>Reduce landfill waste and greenhouse gas emissions.</li>
                <li>Support a sustainable future for generations to come.</li>
            </ul>
        </section>
    );
};

export default Whyrecycle;
